function Header() {
    return (
        <div className="header">
            <Router>
                <div>
                    <nav>
                        <ul>
                            <li>
                            <Link to="/">მთავარი</Link>
                            </li>
                            <li>
                            <Link to="/about">
                                <div>
                                    <Button aria-controls="simple-menu" aria-haspopup="true">
                                        ჩვენს შესახებ
                                    </Button>
                                    <Menu id="simple-menu" anchorEl={anchorEl} keepMounted open={Boolean(anchorEl)} onClose={handleClose}>
                                        <MenuItem>Profile</MenuItem>
                                        <MenuItem>My account</MenuItem>
                                        <MenuItem>Logout</MenuItem>
                                    </Menu>
                                </div>
                            </Link>
                            </li>
                            <li>
                            <Link to="/users">Users</Link>
                            </li>
                        </ul>
                    </nav>

                    <Switch>
                        <Route path="/about">
                            <About />
                        </Route>
                        <Route path="/users">
                            <Users />
                        </Route>
                        <Route path="/">
                            <Home />
                        </Route>
                        <Route path="*">
                            <NotFound />
                        </Route>
                    </Switch>
                </div>
            </Router>
        </div>
    )
}
function Home() {
    return <h2>მთავარი</h2>;
}

function About() {
    return <h2>About</h2>;
}

function Users() {
    return <h2>Users</h2>;
}

const NotFound = () => {
    return <>Page not Found {setTimeout(() => { window.location = "/" }, 2000)}</>
}

export default Header
